databaseChangeLog:
  - logicalFilePath: no-path
  - changeSet:
      id: create-table-users
      author: test
      preConditions:
        - onFail: HALT
        - not:
            - tableExists:
                tableName: users
      changes:
        - createTable:
            tableName: users
            columns:
              - column:
                  name: id
                  type: uuid
                  constraints:
                    nullable: false
                    primaryKey: true
              - column:
                  name: name
                  type: varchar(500)
                  constraints:
                    nullable: false
                    unique: true
              - column:
                  name: date_of_birth
                  type: date
                  constraints:
                    nullable: false
              - column:
                  name: password
                  type: varchar(500)
                  constraints:
                    nullable: false

  - changeSet:
      id: create-table-account
      author: test
      preConditions:
        - onFail: HALT
        - not:
            - tableExists:
                tableName: account
      changes:
        - createTable:
            tableName: account
            columns:
              - column:
                  name: id
                  type: uuid
                  constraints:
                    nullable: false
                    primaryKey: true
              - column:
                  name: user_id
                  type: uuid
                  constraints:
                    nullable: false
              - column:
                  name: balance
                  type: decimal(19,2)
                  constraints:
                    nullable: false

  - changeSet:
      id: create-table-email-data
      author: test
      preConditions:
        - onFail: HALT
        - not:
            - tableExists:
                tableName: email_data
      changes:
        - createTable:
            tableName: email_data
            columns:
              - column:
                  name: id
                  type: uuid
                  constraints:
                    nullable: false
                    primaryKey: true
              - column:
                  name: user_id
                  type: uuid
                  constraints:
                    nullable: false
              - column:
                  name: email
                  type: varchar(200)
                  constraints:
                    nullable: false

  - changeSet:
      id: create-table-phone-data
      author: test
      preConditions:
        - onFail: HALT
        - not:
            - tableExists:
                tableName: phone_data
      changes:
        - createTable:
            tableName: phone_data
            columns:
              - column:
                  name: id
                  type: uuid
                  constraints:
                    nullable: false
                    primaryKey: true
              - column:
                  name: user_id
                  type: uuid
                  constraints:
                    nullable: false
              - column:
                  name: phone
                  type: varchar(13)
                  constraints:
                    nullable: false

